import Item from "../componets/Item";
import ItemList from "..components/ItemList"
import { Link } from 'react-router-dom';

function Home(){
    return (
        <div>
            <Link to="add-item">
                <button>Lisa uus ese</button>
            </Link>
            <ItemList />
            <Item name="Item1" price="10" category="mobile"></Item>
            <Item name="Item2" price="20" category="laptop"></Item>
        </div>
    )
}

export default Home;
